INSERT INTO `risk_api_document` VALUES ('1', 'zmUserAuthUrl', '{\r\n    apiCode: \'zmUserAuthUrl\',\r\n    apiName: \'获取授权查询芝麻信用分的url\',\r\n    note: \'获取用户授权的url，发送给用户，用户通过浏览器打开进行授权\',\r\n    ts: \'2017-06-30\',\r\n    requestuUrl: \'https://data.imfbp.com/risk/api/zmxy/zmUserAuthUrl\',\r\n    requestMethod: \'POST\',\r\n    contentType: \'application/x-www-form-urlencoded\',\r\n    returnType: \'JSON\',\r\n    requestSample: [\r\n    {\r\n      type: \'curl\',\r\n      example: \'\'\r\n    },\r\n    {\r\n      type: \'Java\',\r\n      example: \'<div class=\"dp-highlighter\"><div class=\"bar\"></div><ol start=\"1\" class=\"dp-j\"><li class=\"alt\"><span><span class=\"keyword\">public</span><span>&nbsp;</span><span class=\"keyword\">static</span><span>&nbsp;</span><span class=\"keyword\">void</span><span>&nbsp;main(String[]&nbsp;args)&nbsp;</span><span class=\"keyword\">throws</span><span>&nbsp;Exception{&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;Map&lt;String,&nbsp;String&gt;&nbsp;params&nbsp;=&nbsp;<span class=\"keyword\">new</span><span>&nbsp;HashMap&lt;String,&nbsp;String&gt;();&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"account\"</span><span>,&nbsp;</span><span class=\"string\">\"账户\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"accessKey\"</span><span>,&nbsp;</span><span class=\"string\">\"访问凭证\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"sTransactionId\"</span><span>,&nbsp;</span><span class=\"string\">\"小于等于30位数字的流水号\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"sName\"</span><span>,&nbsp;</span><span class=\"string\">\"姓名\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;