string\">\"sIdNo\"</span><span>,&nbsp;</span><span class=\"string\">\"身份证号\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;HttpPost&nbsp;httpPost&nbsp;=&nbsp;<span class=\"keyword\">new</span><span>&nbsp;HttpPost(</span><span class=\"string\">\"https://data.imfbp.com/risk/api/zmxy/zmAuthInfo\"</span><span>);&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;List&lt;NameValuePair&gt;&nbsp;pairLst&nbsp;=&nbsp;<span class=\"keyword\">new</span><span>&nbsp;ArrayList&lt;NameValuePair&gt;();&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"keyword\">for</span><span>&nbsp;(Map.Entry&lt;String,&nbsp;String&gt;&nbsp;entry&nbsp;:&nbsp;params.entrySet())&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;pairLst.add(<span class=\"keyword\">new</span><span>&nbsp;BasicNameValuePair(entry.getKey(),&nbsp;entry.getValue()));&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;&nbsp;&nbsp;&nbsp;</span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;httpPost.setEntity(<span class=\"keyword\">new</span><span>&nbsp;UrlEncodedFormEntity(pairLst,&nbsp;</span><span class=\"string\">\"UTF-8\"</span><span>));&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;CloseableHttpResponse&nbsp;response&nbsp;=&nbsp;HttpClients.createDefault().execute(httpPost);&nbsp;&nbsp;&nbsp;&nbsp;</span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(EntityUtils.toString(response.getEntity(),&nbsp;<span class=\"string\">\"UTF-8\"</span><span>));&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>}&nbsp;&nbsp;</span></li></ol></div>\'\r\n    },\r\n    {\r\n      type: \'PHP\',\r\n      example: \'\'\r\n    }\r\n  ],\r\n    