INSERT INTO `risk_api_document` VALUES ('214', 'mfDatasources', '{\r\n    apiCode: \'mfDatasources\',\r\n    apiName: \'获取采集的数据源列表\',\r\n    note: \'用户的个人报告是通过采集数据源列表获得，通过此接口获取可以采集的数据源列表\',\r\n    ts: \'2017-06-30\',\r\n    requestuUrl: \'https://data.imfbp.com/risk/api/mf/collection/mfDatasources\',\r\n    requestMethod: \'GET\',\r\n    contentType: \'\',\r\n    returnType: \'JSON\',\r\n    requestSample: [\r\n    {\r\n      type: \'curl\',\r\n      example: \'\'\r\n    },\r\n    {\r\n      type: \'Java\',\r\n      example: \'<div class=\"dp-highlighter\"><div class=\"bar\"></div><ol start=\"1\" class=\"dp-j\"><li class=\"alt\"><span><span class=\"keyword\">public</span><span>&nbsp;</span><span class=\"keyword\">static</span><span>&nbsp;</span><span class=\"keyword\">void</span><span>&nbsp;main(String[]&nbsp;args)&nbsp;</span><span class=\"keyword\">throws</span><span>&nbsp;Exception{&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;Map&lt;String,&nbsp;String&gt;&nbsp;params&nbsp;=&nbsp;<span class=\"keyword\">new</span><span>&nbsp;HashMap&lt;String,&nbsp;String&gt;();&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"account\"</span><span>,&nbsp;</span><span class=\"string\">\"账户\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"accessKey\"</span><span>,&nbsp;</span><span class=\"string\">\"访问凭证\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"sTransactionId\"</span><span>,&nbsp;</span><span class=\"string\">\"小于等于30位数字的流水号\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;StringBuilder&nbsp;sb&nbsp;=&nbsp;<span class=\"keyword\">new</span><span>&nbsp;StringBuilder(</span><span class=\"string\">\"https://data.imfbp.com/risk/api/mf/collection/mfDatasources\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"keyword\">if</span><span>&nbsp;(params&nbsp;!=&nbsp;</span><span class=\"keyword\">null</span><span>)&nbsp;{&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"keyword\">for</span><span>&nbsp;(Entry&lt;String,&nbsp;String&gt;&nbsp;entry&nbsp;:&nbsp;params.entrySet())&nbsp;{&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"keyword\">if</span><span>&nbsp;(sb.toString().contains(</span><span class=\"string\">\"?\"</span><span>))&nbsp;{&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;sb.append(<span class=\"string\">\"&amp;\"</span><span>).append(entry.getKey()).append(</span><span class=\"string\">\"=\"</span><span>).append(entry.getValue());&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;<span class=\"keyword\">else</span><span>&nbsp;{&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;sb.append(<span class=\"string\">\"?\"</span><span>).append(entry.getKey()).append(</span><span class=\"string\">\"=\"</span><span>).append(entry.getValue());&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;&nbsp;</span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;&nbsp;</span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;&nbsp;</span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;CloseableHttpClient&nbsp;httpClient&nbsp;=&nbsp;HttpClients.createDefault();&nbsp;&nbsp;</