\n        {name: \'accessKey\',type: \'String\',isNeed: \'必填\',note: \'访问凭证\'},\r\n        {name: \"sTransactionId\", type: \'String\', isNeed: \'选填\', note: \'流水号,小于等于30位的一串数字，用于定位该次请求\'},\r\n        {name: \"token\", type: \'String\', isNeed: \'必填\', note: \'提交申请单处获取的token\'}\r\n      ],\r\n    returnParams: [\r\n        {name: \'code\', type: \'int\', note: \'结果编码\'},\r\n        {name: \'msg\', type: \'String\', note: \'对结果编码的解释\'},\r\n        {name: \'data\', type: \'dddd\', note: \'结果参考数据字典\'}\r\n      ],\r\n    resultSuccessCodes: \'<div class=\"dp-highlighter\"><div class=\"bar\"></div><ol start=\"1\" class=\"dp-j\"><li class=\"alt\"><span><span>{&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;<span class=\"string\">\"msg\"</span><span>&nbsp;:&nbsp;</span><span class=\"string\">\"success\"</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;<span class=\"string\">\"code\"</span><span>&nbsp;:&nbsp;</span><span class=\"number\">200</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;<span class=\"string\">\"data\"</span><span>&nbsp;:&nbsp;{&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"string\">\"process_code\"</span><span>&nbsp;:&nbsp;</span><span class=\"number\">10008</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"string\">\"finish\"</span><span>&nbsp;:&nbsp;</span><span class=\"keyword\">true</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"string\">\"type\"</span><span>&nbsp;:&nbsp;</span><span class=\"string\">\"CONTROL\"</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"string\">\"content\"</span><span>&nbsp;:&nbsp;</span><span class=\"string\">\"跳过成功\"</span><span>&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;}&nbsp;&nbsp;</span></li><li class=\"\"><span>}&